import icon_acasa from "../../icons/acasa.svg";
import icon_echipa from "../../icons/echipa.svg";
import icon_istorie from "../../icons/istorie.svg";
import icon_meciuri from "../../icons/meciuri.svg";
import icon_multimedia from "../../icons/multimedia.svg";
import icon_palmares from "../../icons/palmares.svg";
import icon_stiri from "../../icons/stiri.svg";

export const SidebarData = [
  {
    title: "ACASA",
    icon: <img src={icon_acasa} alt="acasa" />,
    link: "/acasa",
  },
  {
    title: "ECHIPA",
    icon: <img src={icon_echipa} alt="echipa" />,
    link: "/echipa",
  },
  {
    title: "MECIURI",
    icon: <img src={icon_meciuri} alt="meciuri" />,
    link: "/meciuri",
  },
  {
    title: "ISTORIE",
    icon: <img src={icon_istorie} alt="istorie" />,
    link: "/istorie",
  },
  {
    title: "STIRI",
    icon: <img src={icon_stiri} alt="stiri" />,
    link: "/stiri",
  },
  {
    title: "PALMARES",
    icon: <img src={icon_palmares} alt="palmares" />,
    link: "/palmares",
  },
  {
    title: "MULTIMEDIA",
    icon: <img src={icon_multimedia} alt="multimedia" />,
    link: "/multimedia",
  },
  {
    title: "LOGIN",
    icon: <img src={icon_multimedia} alt="login" />,
    link: "/login",
  },
];
